class Character {

	constructor(name, token, isPlayer, weaponPredicate) {
		this.name = name;
		this.token = token;
		this.isPlayer = isPlayer;
		this.weaponPredicate = weaponPredicate;
	}

	canUseWeapon(weapon, isPrimary) {
		this.weaponPredicate(weapon, isPrimary);
	}

}

